import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className='scoreboard'>
        <Header title="Call Routing" />

        {prop.initPlayers.map(e => 
            <Player key={e.id.toString()} name={e.name} />    
        )}

    </div>
  );
}

export default App;
